% Define the time range for t (continuous time) 
t = linspace(-10, 10, 1001);  % Fine sampling for smooth plots, includes t=0

% Unit Impulse Signal: Represented as a vertical line at t=0
figure(1); %[output:21e42661]
plot([0 0], [0 1], 'b', 'LineWidth', 2);  % Vertical line from 0 to 1 at t=0 %[output:21e42661]
xlim([-10 10]); %[output:21e42661]
ylim([0 1.2]); %[output:21e42661]
title('Continuous time unit impulse signal'); %[output:21e42661]
xlabel('continuous time t --->'); %[output:21e42661]
ylabel('amplitude'); %[output:21e42661]
grid on; %[output:21e42661]
saveas(gcf, 'unit_impulse.png');  % Save plot as image for README %[output:21e42661]

% Unit Step Signal: u(t) = 1 for t >= 0, 0 otherwise
step = (t >= 0);  % Heaviside step function
figure(2); %[output:054196dd]
plot(t, step); %[output:054196dd]
title('Unit step signal'); %[output:054196dd]
xlabel('continuous time t --->'); %[output:054196dd]
ylabel('amplitude'); %[output:054196dd]
grid on; %[output:054196dd]
saveas(gcf, 'unit_step.png');  % Save plot as image for README %[output:054196dd]

% Unit Ramp Signal: r(t) = t for t >= 0, 0 otherwise
ramp = t .* (t >= 0);  % t multiplied by step function
figure(3); %[output:62945038]
plot(t, ramp); %[output:62945038]
title('Unit ramp signal'); %[output:62945038]
xlabel('continuous time t --->'); %[output:62945038]
ylabel('amplitude'); %[output:62945038]
grid on; %[output:62945038]
saveas(gcf, 'unit_ramp.png');  % Save plot as image for README %[output:62945038]

% Exponential Signal: x(t) = exp(-a * t) (non-causal, decaying as t increases)
a = 0.2;  % Decay factor chosen to approximate image scale (high at t=-10 ~7.4, low at t=10 ~0.14)
exponential = exp(-a * t);  % Exponential over all t
figure(4); %[output:4fffc34a]
plot(t, exponential); %[output:4fffc34a]
title('continuous time exponential signal'); %[output:4fffc34a]
xlabel('continuous time t --->'); %[output:4fffc34a]
ylabel('amplitude'); %[output:4fffc34a]
grid on; %[output:4fffc34a]
saveas(gcf, 'exponential_signal.png');  % Save plot as image for README %[output:4fffc34a]

% Signum Function: sgn(t) = 1 for t > 0, -1 for t < 0, 0 for t = 0
signum = sign(t);  % Built-in sign function in MATLAB
figure(5); %[output:69ac3f53]
plot(t, signum); %[output:69ac3f53]
title('continuous time signum function'); %[output:69ac3f53]
xlabel('continuous time t --->'); %[output:69ac3f53]
ylabel('amplitude'); %[output:69ac3f53]
grid on; %[output:69ac3f53]
saveas(gcf, 'signum_function.png');  % Save plot as image for README %[output:69ac3f53]

% Sinc Function: sinc(t) = sin(t)/t for t â‰  0, 1 for t = 0 (unnormalized)
sinc_func = sin(t) ./ t;  % Element-wise division
sinc_func(t == 0) = 1;  % Set limit value at t=0
figure(6); %[output:7364331d]
plot(t, sinc_func); %[output:7364331d]
title('continuous time sinc function'); %[output:7364331d]
xlabel('continuous time t --->'); %[output:7364331d]
ylabel('amplitude'); %[output:7364331d]
grid on; %[output:7364331d]
saveas(gcf, 'sinc_function.png');  % Save plot as image for README %[output:7364331d]

